import Header from "./Header";

function Checkout() {
  return (
    <div className="text-white justify-center ">
      <Header />
      <form action="">
        <div>
          <label htmlFor="firstName">First name</label>
          <input type="text" name="firstName" id="firstName" />
        </div>
      </form>
    </div>
  );
}

export default Checkout;
